import React, {Component} from "react"
import {MenuItems} from "./MenuItems"
class NavBar extends Component{
    render(){
        return(
            <nav className="NavbarItems">
                <h1 className="navbar-logo">Logo</h1>
                <div className="menu-icon">

                </div>
                <ul>
                    <li><a href=""></a></li>
                </ul>
            </nav>)
    }
}
export default NavBar
